(defn mirrored-pair? [[a b c d]]
  (and (not= a b) (= [a b] [d c])))

(defn has-mirrored-pair? [s]
  (->> s (partition 4 1) (filter mirrored-pair?) (seq) (boolean)))

(defn parse-line [s]
  (let [chunks (map-indexed vector (str/split s #"\[|\]"))]
    {:outside (->> chunks (filter #(-> % first even?)) (map second))
     :inside  (->> chunks (filter #(-> % first  odd?)) (map second))}))

(defn supports-tls? [s]
  (let [{:keys [:outside :inside]} (parse-line s)]
    (boolean
      (and
        (->> inside (not-any? has-mirrored-pair?))
        (->> outside (some has-mirrored-pair?))))))


(assert (false? (supports-tls? "abcd[bddb]xyyx")))
(assert (false? (supports-tls? "aaaa[qwer]tyui")))
(assert (true?  (supports-tls? "abba[mnop]qrst")))
(assert (true?  (supports-tls? "ioxxoj[asdfgh]zxcvbn")))




(defn triplet? [[a b c]]
  (and (= a c) (not= a b c)))

(defn triplets
  "{#{a b} [[a b a]]}"
  [s]
  (->> s (partition 3 1) (filter triplet?) (group-by set)))

(defn supports-ssl? [s]
  (let [{:keys [:outside :inside] :as foo} (parse-line s)
        in-tri (->> inside  (map triplets) (apply merge))
        ou-tri (->> outside (map triplets) (apply merge))]
    (reduce-kv
      (fn rf [_ k v1]
        (let [s1 (set v1)
              s2 (set (get ou-tri k))]
          ;; set count should only be 1 or 2:
          ;; 0 is pre-excluded,
          ;; 3+ is impossible for seqs of triplets
          (if (and (contains? ou-tri k)
                   (or (-> s1 count (> 1))
                       (-> s2 count (> 1))
                       (not= s1 s2)))
            (reduced true)
            false)))
      false
      in-tri)))


(assert (false? (supports-ssl? "xyx[xyx]xyx")))
(assert (true? (supports-ssl? "aba[bab]xyz")))
(assert (true? (supports-ssl? "aaa[kek]eke")))
(assert (true? (supports-ssl? "zazbz[bzb]cdb")))


(defn f [input predicate]
  (->> input (str/split-lines) (filter predicate) (count)))

(assert (= 110 (f input supports-tls?)))
(assert (= 242 (f input supports-ssl?)))